import React from 'react';

import './Login.scss';

import Icon from "../../assets/icons/spotify-icon-green.svg"

const Login = () => (
    <main className="login" data-testid="login">
        <div className="container">
            <img src={Icon} alt="Icon"/>
        </div>
    </main>);

export default Login;
